import React from 'react';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faFacebook, faGithub, faInstagram, faLinkedin, faYoutube } from "@fortawesome/free-brands-svg-icons";
import { faEnvelope } from "@fortawesome/free-solid-svg-icons";
import "./Landing.css";

function Landing() {
    return (
        <React.Fragment>
            <div className="col-12 col-md-6">
            <h1 className="mainTitle text-white text-md-start text-center my-2">Achyut Neupane</h1>
            </div>
            <div class="col-12">
            <div className="d-flex flex-row justify-content-center justify-content-md-start text-white gap-2">
                <FontAwesomeIcon icon={faFacebook} size='2x' style={{ color: '#ffffff' }}/>
                <FontAwesomeIcon icon={faInstagram} size='2x' style={{ color: '#ffffff' }}/>
                <FontAwesomeIcon icon={faLinkedin} size='2x' style={{ color: '#ffffff' }}/>
                <FontAwesomeIcon icon={faGithub} size='2x' style={{ color: '#ffffff' }}/>
                <FontAwesomeIcon icon={faYoutube} size='2x' style={{ color: '#ffffff' }}/>
                <FontAwesomeIcon icon={faEnvelope} size='2x' style={{ color: '#ffffff' }}/>
            </div>
            </div>
        </React.Fragment>
    )
}

export default Landing
